INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('3', 'basic', 'oom-use-tmp-storage', 'TiDB', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Controls whether to enable the temporary storage for some operators when a single SQL statement exceeds the memory quota specified by mem-quota-query.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('4', 'basic', 'compatible-kill-query', 'TiDB', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Determines whether to set the KILL statement to be MySQL compatible.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('5', 'basic', 'enable-telemetry', 'TiDB', 'tidb_enable_telemetry', 2, null, '["true", "false"]', 1, 1, 0, 0, 'Enables or disables the telemetry collection in TiDB.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('6', 'basic', 'enable-tcp4-only', 'TiDB', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Enables or disables listening on TCP4 only.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('7', 'basic', 'enable-enum-length-limit', 'TiDB', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Determines whether to limit the maximum length of a single ENUM element and a single SET element.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('8', 'basic', 'token-limit', 'TiDB', null, 0, null, '["0", "1000000"]', 1, 1, 0, 0, 'The number of sessions that can execute requests concurrently.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('9', 'basic', 'mem-quota-query', 'TiDB', 'tidb_mem_quota_query', 0, 'b', '["-1", "274877906944"]', 0, 1, 1, 0, 'The maximum memory available for a single SQL statement.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('10', 'basic', 'tmp-storage-quota', 'TiDB', null, 0, null, '["-1", "34359738368"]', 1, 1, 0, 0, 'Specifies the quota for the storage in tmp-storage-path. The unit is byte.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('11', 'basic', 'lease', 'TiDB', null, 1, 's', '["1s ~ 300s"]', 1, 1, 0, 0, 'The timeout of the DDL lease.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('12', 'basic', 'max-server-connections', 'TiDB', 'max_connections', 0, null, '["0", "100000"]', 1, 1, 0, 0, 'The maximum number of concurrent client connections allowed in TiDB. It is used to control resources.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('13', 'basic', 'max-index-length', 'TiDB', null, 0, 'b', '["3072", "12288"]', 1, 1, 0, 0, 'Sets the maximum allowable length of the newly created index.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('14', 'basic', 'table-column-count-limit', 'TiDB', null, 0, null, '["1017", "4096"]', 1, 1, 0, 0, 'Sets the limit on the number of columns in a single table.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('15', 'basic', 'index-limit', 'TiDB', null, 0, null, '["64", "512"]', 1, 1, 0, 0, 'Sets the limit on the number of indexes in a single table.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('16', 'basic', 'graceful-wait-before-shutdown', 'TiDB', null, 0, null, '["0", "600"]', 1, 1, 0, 0, 'Specifies the number of seconds that TiDB waits when you shut down the server, which allows the clients to disconnect.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('17', 'txn-local-latches', 'enable', 'TiDB', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Determines whether to enable the memory lock of transactions.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('18', 'txn-local-latches', 'capacity', 'TiDB', null, 0, null, '["0", "100000"]', 1, 1, 0, 0, 'The number of slots corresponding to Hash, which automatically adjusts upward to an exponential multiple of 2. Each slot occupies 32 Bytes of memory. If set too small, it might result in slower running speed and poor performance in the scenario where data writing covers a relatively large range (such as importing data).', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('19', 'tikv-client.copr-cache', 'capacity-mb', 'TiDB', null, 3, null, '["0.0", "262144.0"]', 1, 1, 0, 0, 'The total size of the cached data. When the cache space is full, old cache entries are evicted. When the value is 0.0, the Coprocessor Cache feature is disabled.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('20', 'tikv-client', 'grpc-connection-count', 'TiDB', null, 0, null, '["1", "1024"]', 1, 1, 0, 0, 'The maximum number of connections established with each TiKV.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('21', 'tikv-client', 'grpc-keepalive-time', 'TiDB', null, 0, 's', '["1", "60"]', 1, 1, 0, 0, 'The keepalive time interval of the RPC connection between TiDB and TiKV nodes. If there is no network packet within the specified time interval, the gRPC client executes ping command to TiKV to see if it is alive.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('22', 'tikv-client', 'grpc-keepalive-timeout', 'TiDB', null, 0, 's', '["1", "60"]', 1, 1, 0, 0, 'The timeout of the RPC keepalive check between TiDB and TiKV nodes.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('23', 'tikv-client', 'commit-timeout', 'TiDB', null, 1, 's', null, 1, 1, 0, 0, 'The maximum timeout when executing a transaction commit.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('24', 'tikv-client', 'max-batch-size', 'TiDB', null, 0, null, '["0", "2048"]', 1, 1, 0, 0, 'The maximum number of RPC packets sent in batch. If the value is not 0, the BatchCommands API is used to send requests to TiKV, and the RPC latency can be reduced in the case of high concurrency. It is recommended that you do not modify this value.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('25', 'tikv-client', 'max-batch-wait-time', 'TiDB', null, 0, 'ns', null, 1, 1, 0, 0, 'Waits for max-batch-wait-time to encapsulate the data packets into a large packet in batch and send it to the TiKV node. It is valid only when the value of tikv-client.max-batch-size is greater than 0. It is recommended not to modify this value.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('26', 'tikv-client', 'batch-wait-size', 'TiDB', null, 0, null, '["0", "128"]', 1, 1, 0, 0, 'The maximum number of packets sent to TiKV in batch. It is recommended not to modify this value.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('27', 'tikv-client', 'overload-threshold', 'TiDB', null, 0, null, '["0", "1000"]', 1, 1, 0, 0, 'The threshold of the TiKV load. If the TiKV load exceeds this threshold, more batch packets are collected to relieve the pressure of TiKV. It is valid only when the value of tikv-client.max-batch-size is greater than 0. It is recommended not to modify this value.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('28', 'stmt-summary', 'max-stmt-count', 'TiDB', null, 0, null, '["1", "10240"]', 1, 1, 0, 0, 'The maximum number of SQL categories allowed to be saved in statement summary tables.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('29', 'stmt-summary', 'max-sql-length', 'TiDB', null, 0, null, '["32", "40960"]', 1, 1, 0, 0, 'The longest display length for the DIGEST_TEXT and QUERY_SAMPLE_TEXT columns in statement summary tables.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('30', 'status', 'report-status', 'TiDB', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Enables or disables the HTTP API service.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('31', 'status', 'record-db-qps', 'TiDB', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Determines whether to transmit the database-related QPS metrics to Prometheus.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('32', 'security', 'spilled-file-encryption-method', 'TiDB', null, 1, null, '["plaintext", "aes128-ctr"]', 1, 1, 0, 0, 'Determines the encryption method used for saving the spilled files to disk.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('33', 'security', 'require-secure-transport', 'TiDB', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Determines whether to require the client to use the secure mode for data transport.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('34', 'security', 'auto-tls', 'TiDB', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Determines whether to automatically generate the TLS certificates on startup.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('35', 'security', 'enable-sem', 'TiDB', 'tidb_enable_enhanced_security', 2, null, '["true", "false"]', 1, 1, 0, 0, 'Enables the Security Enhanced Mode (SEM).', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('36', 'prepared-plan-cache', 'enabled', 'TiDB', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Determines whether to enable Plan Cache of the PREPARE statement.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('37', 'prepared-plan-cache', 'capacity', 'TiDB', null, 0, null, '["0", "100000"]', 1, 1, 0, 0, 'The number of cached statements.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('38', 'prepared-plan-cache', 'memory-guard-ratio', 'TiDB', null, 3, null, '["0.1", "1.0"]', 1, 1, 0, 0, 'It is used to prevent performance.max-memory from being exceeded. When max-memory * (1 - prepared-plan-cache.memory-guard-ratio) is exceeded, the elements in the LRU are removed.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('39', 'pessimistic-txn', 'deadlock-history-collect-retryable', 'TiDB', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Controls whether the INFORMATION_SCHEMA.DEADLOCKS table collects the information of retryable deadlock errors. For the description of retryable deadlock errors, see Retryable deadlock errors.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('40', 'pessimistic-txn', 'max-retry-count', 'TiDB', null, 0, null, '["0", "512"]', 1, 1, 0, 0, 'The maximum number of retries of each statement in pessimistic transactions. If the number of retries exceeds this limit, an error occurs.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('41', 'pessimistic-txn', 'deadlock-history-capacity', 'TiDB', null, 0, null, '["0", "10000"]', 1, 1, 0, 0, 'The maximum number of deadlock events that can be recorded in the INFORMATION_SCHEMA.DEADLOCKS table of a single TiDB server. If this table is in full volume and an additional deadlock event occurs, the earliest record in the table will be removed to make place for the newest error.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('42', 'performance', 'tcp-keep-alive', 'TiDB', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Determines whether to enable keepalive in the TCP layer.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('43', 'performance', 'tcp-no-delay', 'TiDB', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Determines whether to enable TCP_NODELAY at the TCP layer. After it is enabled, TiDB disables the Nagle algorithm in the TCP/IP protocol and allows sending small data packets to reduce network latency. This is suitable for latency-sensitive applications with a small transmission volume of data.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('44', 'performance', 'run-auto-analyze', 'TiDB', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Determines whether TiDB executes automatic analysis.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('45', 'performance', 'distinct-agg-push-down', 'TiDB', 'tidb_opt_distinct_agg_push_down', 2, null, '["true", "false"]', 0, 1, 1, 0, 'Determines whether the optimizer executes the operation that pushes down the aggregation function with Distinct (such as select count(distinct a) from t) to Coprocessors.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('46', 'performance', 'enforce-mpp', 'TiDB', 'tidb_enforce_mpp', 2, null, '["true", "false"]', 1, 1, 0, 0, 'Determines whether to ignore the optimizer''s cost estimation and to forcibly use TiFlash''s MPP mode for query execution.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('47', 'performance', 'server-memory-quota', 'TiDB', null, 0, 'b', '["0", "68719476736"]', 1, 1, 0, 0, 'The memory usage limit of tidb-server instances. This configuration item completely supersedes the previous max-memory.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('48', 'performance', 'memory-usage-alarm-ratio', 'TiDB', null, 3, null, '["0","1"]', 1, 1, 0, 0, 'TiDB triggers an alarm when the memory usage of tidb-server instance exceeds a certain threshold. The valid value for this configuration item ranges from 0 to 1. If it is configured as 0 or 1, this alarm feature is disabled.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('49', 'performance', 'txn-entry-size-limit', 'TiDB', null, 0, 'b', '["1", "125829120"]', 1, 1, 0, 0, 'The size limit of a single row of data in TiDB.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('50', 'performance', 'txn-total-size-limit', 'TiDB', null, 0, null, '["1", "10737418240"]', 1, 1, 0, 0, 'The size limit of a single transaction in TiDB.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('51', 'performance', 'max-txn-ttl', 'TiDB', null, 0, null, '["1000", "21600000"]', 1, 1, 0, 0, 'The longest time that a single transaction can hold locks. If this time is exceeded, the locks of a transaction might be cleared by other transactions so that this transaction cannot be successfully committed.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('52', 'performance', 'committer-concurrency', 'TiDB', null, 0, null, '["1", "1280"]', 1, 1, 0, 0, 'The number of goroutines for requests related to executing commit in the commit phase of the single transaction.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('53', 'performance', 'stmt-count-limit', 'TiDB', null, 0, null, '["1", "10240"]', 1, 1, 0, 0, 'The maximum number of statements allowed in a single TiDB transaction.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('54', 'performance', 'stats-lease', 'TiDB', null, 1, 's', '["1s ~ 300s"]', 1, 1, 0, 0, 'The time interval of reloading statistics, updating the number of table rows, checking whether it is needed to perform the automatic analysis, using feedback to update statistics and loading statistics of columns.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('55', 'performance', 'query-feedback-limit', 'TiDB', null, 0, null, '["1", "10240"]', 1, 1, 0, 0, 'The maximum pieces of query feedback that can be cached in memory. Extra pieces of feedback that exceed this limit are discarded.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('56', 'performance', 'pseudo-estimate-ratio', 'TiDB', null, 3, null, '["0.1", "1.0"]', 1, 1, 0, 0, 'The ratio of (number of modified rows)/(total number of rows) in a table. If the value is exceeded, the system assumes that the statistics have expired and the pseudo statistics will be used.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('57', 'performance', 'nested-loop-join-cache-capacity', 'TiDB', null, 0, 'b', null, 1, 1, 0, 0, 'The maximum memory usage for the Least Recently Used (LRU) algorithm of the nested loop join cache (in bytes).', '1609459200000', '1609459200000');
