INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('74', 'server', 'grpc-memory-pool-quota', 'TiKV', null, 0, null, '["1024", "9223372036854775807"]', 1, 0, 0, 0, 'Limits the memory size that can be used by gRPC.', '1609459200000', '1609459200000');
