INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('82', 'server', 'end-point-request-max-handle-duration', 'TiKV', null, 1, 's', '["1s ~ 60s"]', 1, 1, 0, 0, 'The longest duration allowed for a TiDB''s push down request to TiKV for processing tasks.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('83', 'server', 'snap-max-write-bytes-per-sec', 'TiKV', null, 1, null, '["1KB ~ 1GB"]', 1, 1, 0, 0, 'The maximum allowable disk bandwidth when processing snapshots.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('84', 'server', 'end-point-slow-log-threshold', 'TiKV', null, 1, 's', '["0s ~ 3600s"]', 1, 1, 0, 0, 'The time threshold for a TiDB''s push-down request to output slow log. If the processing time is longer than this threshold, the slow logs are output.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('85', 'readpool.unified', 'min-thread-count', 'TiKV', null, 0, null, '["1"]', 1, 1, 0, 0, 'The minimal working thread count of the unified read pool.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('86', 'readpool.unified', 'max-thread-count', 'TiKV', null, 0, null, '["256"]', 1, 0, 0, 0, 'The maximum working thread count of the unified read pool or the UnifyReadPool thread pool.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('87', 'readpool.unified', 'stack-size', 'TiKV', null, 1, null, '["2MB ~ 1GB"]', 1, 1, 0, 0, 'The stack size of the threads in the unified thread pool.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('88', 'readpool.unified', 'max-tasks-per-worker', 'TiKV', null, 0, null, '["2", "5000"]', 1, 1, 0, 0, 'The maximum number of tasks allowed for a single thread in the unified read pool. Server Is Busy is returned when the value is exceeded.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('89', 'readpool.storage', 'use-unified-pool', 'TiKV', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Determines whether to use the unified thread pool (configured in readpool.unified) for storage requests. If the value of this parameter is false, a separate thread pool is used, which is configured through the rest parameters in this section (readpool.storage).', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('90', 'readpool.coprocessor', 'use-unified-pool', 'TiKV', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Determines whether to use the unified thread pool (configured in readpool.unified) for coprocessor requests. If the value of this parameter is false, a separate thread pool is used, which is configured through the rest parameters in this section (readpool.coprocessor).', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('91', 'storage', 'scheduler-concurrency', 'TiKV', null, 0, null, '["1", "10485760"]', 1, 1, 0, 0, 'A built-in memory lock mechanism to prevent simultaneous operations on a key. Each key has a hash in a different slot.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('92', 'storage', 'scheduler-worker-pool-size', 'TiKV', null, 0, null, '["1", "256"]', 1, 1, 0, 0, 'The number of scheduler threads, mainly used for checking transaction consistency before data writing.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('93', 'storage', 'scheduler-pending-write-threshold', 'TiKV', null, 1, null, '["1MB ~ 1GB"]', 1, 1, 0, 0, 'The maximum size of the write queue. A Server Is Busy error is returned for a new write to TiKV when this value is exceeded.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('94', 'storage', 'reserve-space', 'TiKV', null, 1, null, '["1MB ~ 64GB"]', 1, 1, 0, 0, 'When TiKV is started, some space is reserved on the disk as disk protection. When the remaining disk space is less than the reserved space, TiKV restricts some write operations.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('95', 'storage', 'enable-ttl', 'TiKV', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'TTL is short for "Time to live". If this item is enabled, TiKV automatically deletes data that reaches its TTL. To set the value of TTL, you need to specify it in the requests when writing data via the client. If the TTL is not specified, it means that TiKV does not automatically delete the corresponding data.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('96', 'storage', 'ttl-check-poll-interval', 'TiKV', null, 1, 'h', '["0s ~ 24h"]', 1, 1, 0, 0, 'The interval of checking data to reclaim physical spaces. If data reaches its TTL, TiKV forcibly reclaims its physical space during the check.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('97', 'storage.block-cache', 'shared', 'TiKV', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Enables or disables the sharing of block cache.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('98', 'storage.block-cache', 'capacity', 'TiKV', null, 1, 'GB', '["1GB ~ 512GB"]', 1, 0, 0, 0, 'The size of the shared block cache.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('99', 'storage.io-rate-limit', 'max-bytes-per-sec', 'TiKV', null, 1, null, '["0MB ~ 8GB"]', 1, 1, 0, 0, 'Limits the maximum I/O bytes that a server can write to or read from the disk (determined by the mode configuration item below) in one second. When this limit is reached, TiKV prefers throttling background operations over foreground ones. ', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('100', 'raftstore', 'raft-base-tick-interval', 'TiKV', null, 1, 's', '["1s ~ 60s"]', 1, 1, 0, 0, 'The time interval at which the Raft state machine ticks.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('101', 'raftstore', 'raft-heartbeat-ticks', 'TiKV', null, 0, null, '["1", "60"]', 1, 1, 0, 0, 'The number of passed ticks when the heartbeat is sent. This means that a heartbeat is sent at the time interval of raft-base-tick-interval * raft-heartbeat-ticks.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('102', 'raftstore', 'raft-election-timeout-ticks', 'TiKV', null, 0, null, '["1", "60"]', 1, 1, 0, 0, 'The number of passed ticks when Raft election is initiated. This means that if Raft group is missing the leader, a leader election is initiated approximately after the time interval of raft-base-tick-interval * raft-election-timeout-ticks.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('103', 'raftstore', 'raft-min-election-timeout-ticks', 'TiKV', null, 0, null, '["0"]', 1, 1, 0, 0, 'The minimum number of ticks during which the Raft election is initiated. If the number is 0, the value of raft-election-timeout-ticks is used. The value of this parameter must be greater than or equal to raft-election-timeout-ticks.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('104', 'raftstore', 'raft-max-election-timeout-ticks', 'TiKV', null, 0, null, '["60"]', 1, 1, 0, 0, 'The maximum number of ticks during which the Raft election is initiated. If the number is 0, the value of raft-election-timeout-ticks * 2 is used.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('105', 'raftstore', 'raft-max-size-per-msg', 'TiKV', null, 1, 'MB', '["0MB ~ 64MB"]', 1, 1, 0, 0, 'The soft limit on the size of a single message packet.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('106', 'raftstore', 'raft-max-inflight-msgs', 'TiKV', null, 0, null, '["1", "512"]', 1, 1, 0, 0, 'The number of Raft logs to be confirmed. If this number is exceeded, log sending slows down.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('107', 'raftstore', 'raft-entry-max-size', 'TiKV', 'raftstore.raft-entry-max-size', 1, 'MB', '["1MB ~ 64MB"]', 0, 1, 3, 0, 'The hard limit on the maximum size of a single log.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('108', 'raftstore', 'raft-log-gc-tick-interval', 'TiKV', 'raftstore.raft-log-gc-tick-interval', 1, 's', '["0s ~ 3600s"]', 0, 1, 3, 0, 'The time interval at which the polling task of deleting Raft logs is scheduled. 0 means that this feature is disabled.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('109', 'raftstore', 'raft-log-gc-threshold', 'TiKV', 'raftstore.raft-log-gc-threshold', 0, null, '["1", "512"]', 0, 1, 3, 0, 'The hard limit on the allowable number of residual Raft logs.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('110', 'raftstore', 'raft-log-gc-count-limit', 'TiKV', 'raftstore.raft-log-gc-count-limit', 0, null, '["0", "512"]', 0, 0, 3, 0, 'The hard limit on the allowable number of residual Raft logs.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('111', 'raftstore', 'raft-log-gc-size-limit', 'TiKV', 'raftstore.raft-log-gc-size-limit', 1, 'MB', '["1MB ~ 1024MB"]', 0, 0, 3, 0, 'The hard limit on the allowable size of residual Raft logs.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('112', 'raftstore', 'raft-entry-cache-life-time', 'TiKV', 'raftstore.raft-entry-cache-life-time', 1, 's', '["0s ~ 180s"]', 0, 1, 3, 0, 'The maximum remaining time allowed for the log cache in memory.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('113', 'raftstore', 'raft-reject-transfer-leader-duration', 'TiKV', 'raftstore.raft-reject-transfer-leader-duration', 1, 's', '["1s ~ 300s"]', 0, 1, 3, 0, 'New node protection time, which controls the minimum time to migrate the leader to the newly added node, setting too small may cause the migration leader to fail.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('114', 'raftstore', 'hibernate-regions', 'TiKV', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Enables or disables Hibernate Region. When this option is enabled, a Region idle for a long time is automatically set as hibernated. This reduces the extra overhead caused by heartbeat messages between the Raft leader and the followers for idle Regions. You can use peer-stale-state-check-interval to modify the heartbeat interval between the leader and the followers of hibernated Regions.', '1609459200000', '1609459200000');
