INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('195', 'pessimistic-txn', 'wait-for-lock-timeout', 'TiKV', 'pessimistic-txn.wait-for-lock-timeout', 1, 'ms', '["1ms ~ 30000ms"]', 0, 1, 3, 0, 'The longest time that a pessimistic transaction in TiKV waits for other transactions to release the lock. If the time is out, an error is returned to TiDB, and TiDB retries to add a lock. The lock wait timeout is set by innodb_lock_wait_timeout.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('196', 'pessimistic-txn', 'wait-up-delay-duration', 'TiKV', 'pessimistic-txn.wait-up-delay-duration', 1, 'ms', '["1ms ~ 30000ms"]', 1, 1, 0, 0, 'When pessimistic transactions release the lock, among all the transactions waiting for lock, only the transaction with the smallest start_ts is woken up. Other transactions will be woken up after wait-up-delay-duration.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('197', 'pessimistic-txn', 'pipelined', 'TiKV', 'pessimistic-txn.pipelined', 2, null, '["true", "false"]', 0, 1, 3, 0, 'This configuration item enables the pipelined process of adding the pessimistic lock. With this feature enabled, after detecting that data can be locked, TiKV immediately notifies TiDB to execute the subsequent requests and write the pessimistic lock asynchronously, which reduces most of the latency and significantly improves the performance of pessimistic transactions. But there is a still low probability that the asynchronous write of the pessimistic lock fails, which might cause the failure of pessimistic transaction commits.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('198', 'rocksdb.defaultcf.titan', 'min-blob-size', 'TiKV', null, 1, 'KB', '["1KB ~ 8192KB"]', 1, 1, 0, 0, 'The smallest value stored in a Blob file. Values smaller than the specified size are stored in the LSM-Tree.', '1609459200000', '1609459200000');
