INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('202', 'rocksdb.defaultcf.titan', 'max-gc-batch-size', 'TiKV', null, 1, 'MB', '["256MB ~ 8192MB"]', 1, 1, 0, 0, 'The maximum total size of Blob files allowed to perform GC for one time.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('203', 'rocksdb.defaultcf.titan', 'discardable-ratio', 'TiKV', null, 3, null, '["0.1", "1.0"]', 1, 1, 0, 0, 'The ratio at which GC is triggered for Blob files. The Blob file can be selected for GC only if the proportion of the invalid values in a Blob file exceeds this ratio.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('204', 'rocksdb.defaultcf.titan', 'sample-ratio', 'TiKV', null, 3, null, '["0.1", "1.0"]', 1, 1, 0, 0, 'The ratio of (data read from a Blob file/the entire Blob file) when sampling the file during GC.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('205', 'rocksdb.defaultcf.titan', 'merge-small-file-threshold', 'TiKV', null, 1, 'MB', '["1MB ~ 4096MB"]', 1, 1, 0, 0, 'When the size of a Blob file is smaller than this value, the Blob file might still be selected for GC. In this situation, discardable-ratio is ignored.', '1609459200000', '1609459200000');
