INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('207', 'rocksdb.defaultcf.titan', 'level-merge', 'TiKV', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Determines whether to optimize the read performance. When level-merge is enabled, there is more write amplification.', '1609459200000', '1609459200000');
