INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('284', 'rocksdb.lockcf', 'max-write-buffer-number', 'TiKV', 'rocksdb.lockcf.max-write-buffer-number', 0, null, '["0", "128"]', 0, 1, 3, 0, 'The maximum number of memtables.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('285', 'rocksdb.lockcf', 'min-write-buffer-number-to-merge', 'TiKV', 'rocksdb.lockcf.min-write-buffer-number-to-merge', 0, null, '["0", "128"]', 1, 1, 0, 0, 'The minimum number of memtables required to trigger flush.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('286', 'rocksdb.lockcf', 'max-bytes-for-level-base', 'TiKV', 'rocksdb.lockcf.max-bytes-for-level-base', 1, 'MB', '["0MB ~ 4096MB"]', 1, 1, 0, 0, 'The maximum number of bytes at base level (L1). Generally, it is set to 4 times the size of a memtable.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('287', 'rocksdb.lockcf', 'target-file-size-base', 'TiKV', 'rocksdb.lockcf.target-file-size-base', 1, 'MB', '["1MB ~ 128MB"]', 0, 1, 3, 0, 'The size of the target file at base level. This value is overridden by compaction-guard-max-output-file-size when the enable-compaction-guard value is true.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('288', 'rocksdb.lockcf', 'level0-file-num-compaction-trigger', 'TiKV', 'rocksdb.lockcf.level0-file-num-compaction-trigger', 0, null, '["0", "64"]', 0, 1, 3, 0, 'The maximum number of files at L0 that trigger compaction.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('289', 'rocksdb.lockcf', 'level0-slowdown-writes-trigger', 'TiKV', 'rocksdb.lockcf.level0-slowdown-writes-trigger', 0, null, '["0", "128"]', 0, 1, 3, 0, 'The maximum number of files at L0 that trigger write stall.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('290', 'rocksdb.lockcf', 'level0-stop-writes-trigger', 'TiKV', 'rocksdb.lockcf.level0-stop-writes-trigger', 0, null, '["0", "128"]', 0, 1, 3, 0, 'The maximum number of files at L0 required to completely block write.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('291', 'rocksdb.lockcf', 'max-compaction-bytes', 'TiKV', 'rocksdb.lockcf.max-compaction-bytes', 1, 'GB', '["0GB ~ 32GB"]', 0, 1, 3, 0, 'The maximum number of bytes written into disk per compaction.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('292', 'rocksdb.lockcf', 'compaction-pri', 'TiKV', null, 0, null, '["0", "3"]', 1, 1, 0, 0, 'The priority type of compaction.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('293', 'rocksdb.lockcf', 'dynamic-level-bytes', 'TiKV', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Determines whether to optimize dynamic level bytes.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('294', 'rocksdb.lockcf', 'max-bytes-for-level-multiplier', 'TiKV', 'rocksdb.lockcf.max-bytes-for-level-multiplier', 0, null, '["1", "100"]', 0, 1, 3, 0, 'The default amplification multiple for each layer.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('295', 'rocksdb.lockcf', 'compaction-style', 'TiKV', null, 0, null, '["0","1"]', 1, 1, 0, 0, 'Compaction method.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('296', 'rocksdb.lockcf', 'disable-auto-compactions', 'TiKV', 'rocksdb.lockcf.disable-auto-compactions', 2, null, '["true", "false"]', 0, 1, 3, 0, 'Enables or disables automatic compaction.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('297', 'rocksdb.lockcf', 'soft-pending-compaction-bytes-limit', 'TiKV', 'rocksdb.lockcf.soft-pending-compaction-bytes-limit', 1, 'GB', '["1GB ~ 512GB"]', 0, 1, 3, 0, 'The soft limit on the pending compaction bytes.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('298', 'rocksdb.lockcf', 'hard-pending-compaction-bytes-limit', 'TiKV', 'rocksdb.lockcf.hard-pending-compaction-bytes-limit', 1, 'GB', '["1GB ~ 4096GB"]', 0, 1, 3, 0, 'The hard limit on the pending compaction bytes.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('299', 'rocksdb.lockcf', 'enable-compaction-guard', 'TiKV', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Enables or disables the compaction guard, which is an optimization to split SST files at TiKV Region boundaries. This optimization can help reduce compaction I/O and allows TiKV to use larger SST file size (thus less SST files overall) and at the time efficiently clean up stale data when migrating Regions.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('300', 'rocksdb.lockcf', 'compaction-guard-min-output-file-size', 'TiKV', null, 1, 'MB', '["1MB ~ 512MB"]', 1, 1, 0, 0, 'The minimum SST file size when the compaction guard is enabled. This configuration prevents SST files from being too small when the compaction guard is enabled.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('301', 'rocksdb.lockcf', 'compaction-guard-max-output-file-size', 'TiKV', null, 1, 'MB', '["2MB ~ 1024MB"]', 1, 1, 0, 0, 'The maximum SST file size when the compaction guard is enabled. The configuration prevents SST files from being too large when the compaction guard is enabled. This configuration overrides target-file-size-base for the same column family.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('302', 'basic', 'lease', 'PD', null, 0, 's', '["1", "180"]', 1, 1, 0, 0, 'The timeout of the PD Leader Key lease. After the timeout, the system re-elects a Leader.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('303', 'basic', 'quota-backend-bytes', 'PD', null, 0, 'b', '["1073741824", "274877906944"]', 1, 1, 0, 0, 'The storage size of the meta-information database, which is 8GiB by default.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('304', 'basic', 'auto-compaction-mod', 'PD', null, 1, null, '["periodic","revision"]', 1, 1, 0, 0, 'The automatic compaction modes of the meta-information database.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('305', 'basic', 'auto-compaction-retention', 'PD', null, 1, 'h', '["1h ~ 8h"]', 1, 1, 0, 0, 'The time interval for automatic compaction of the meta-information database when auto-compaction-retention is periodic. When the compaction mode is set to revision, this parameter indicates the version number for the automatic compaction.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('306', 'security', 'cacert-path', 'PD', null, 1, null, null, 1, 1, 0, 0, 'The path of the CA file.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('307', 'security', 'cert-path', 'PD', null, 1, null, null, 1, 1, 0, 0, 'The path of the Privacy Enhanced Mail (PEM) file that contains the X509 certificate.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('308', 'security', 'key-path', 'PD', null, 1, null, null, 1, 1, 0, 0, 'The path of the PEM file that contains the X509 key.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('309', 'security', 'redact-info-log', 'PD', null, 2, null, '["true", "false"]', 1, 1, 0, 0, 'Controls whether to enable log redaction in the PD log.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('310', 'log.file', 'max-size', 'PD', null, 0, 'MB', '["100", "4096"]', 1, 1, 0, 0, 'The maximum size of a single log file. When this value is exceeded, the system automatically splits the log into several files.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('311', 'log.file', 'max-days', 'PD', null, 0, null, '["0", "1095"]', 1, 1, 0, 0, 'The maximum number of days in which a log is kept.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('312', 'log.file', 'max-backups', 'PD', null, 0, null, '["0", "1095"]', 1, 1, 0, 0, 'The maximum number of log files to keep.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('313', 'metric', 'interval', 'PD', null, 1, null, '["1s ~ 120s"]', 1, 1, 0, 0, 'The interval at which monitoring metric data is pushed to Prometheus.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('314', 'schedule', 'max-merge-region-size', 'PD', null, 0, null, '["2", "1024"]', 0, 1, 3, 0, 'Controls the size limit of Region Merge. When the Region size is greater than the specified value, PD does not merge the Region with the adjacent Regions.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('315', 'schedule', 'max-merge-region-keys', 'PD', null, 0, null, '["1000", "1000000"]', 0, 1, 3, 0, 'Specifies the upper limit of the Region Merge key. When the Region key is greater than the specified value, the PD does not merge the Region with its adjacent Regions.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('316', 'schedule', 'patrol-region-interval', 'PD', null, 1, 'ms', '["10ms ~ 60000ms"]', 0, 1, 3, 0, 'Controls the running frequency at which replicaChecker checks the health state of a Region. The smaller this value is, the faster replicaChecker runs. Normally, you do not need to adjust this parameter.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('317', 'schedule', 'split-merge-interval', 'PD', null, 1, 'h', '["1h ~ 8h"]', 0, 1, 3, 0, 'Controls the time interval between the split and merge operations on the same Region. That means a newly split Region will not be merged for a while.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('318', 'schedule', 'max-snapshot-count', 'PD', null, 0, null, '["1", "128"]', 0, 1, 3, 0, 'Controls the maximum number of snapshots that a single store receives or sends at the same time. PD schedulers depend on this configuration to prevent the resources used for normal traffic from being preempted.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('319', 'schedule', 'max-pending-peer-count', 'PD', null, 0, null, '["1", "128"]', 0, 1, 3, 0, 'Controls the maximum number of pending peers in a single store. PD schedulers depend on this configuration to prevent too many Regions with outdated logs from being generated on some nodes.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('320', 'schedule', 'max-store-down-time', 'PD', null, 1, 'm', '["1m ~ 300m"]', 0, 1, 3, 0, 'The downtime after which PD judges that the disconnected store can not be recovered. When PD fails to receive the heartbeat from a store after the specified period of time, it adds replicas at other nodes.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('321', 'schedule', 'leader-schedule-limit', 'PD', null, 0, null, '["1", "256"]', 0, 1, 3, 0, 'The number of Leader scheduling tasks performed at the same time.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('322', 'schedule', 'region-schedule-limit', 'PD', null, 0, null, '["1", "10240"]', 0, 1, 3, 0, 'The number of Region scheduling tasks performed at the same time.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('323', 'schedule', 'hot-region-schedule-limit', 'PD', null, 0, null, '["1", "64"]', 0, 1, 3, 0, 'Controls the hot Region scheduling tasks that are running at the same time. It is independent of the Region scheduling.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('324', 'schedule', 'hot-region-cache-hits-threshold', 'PD', null, 0, null, '["1", "180"]', 0, 1, 3, 0, 'The threshold used to set the number of minutes required to identify a hot Region. PD can participate in the hotspot scheduling only after the Region is in the hotspot state for more than this number of minutes.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('325', 'schedule', 'replica-schedule-limit', 'PD', null, 0, null, '["1", "512"]', 0, 1, 3, 0, 'The number of Replica scheduling tasks performed at the same time.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('326', 'schedule', 'merge-schedule-limit', 'PD', null, 0, null, '["0", "512"]', 0, 1, 3, 0, 'The number of the Region Merge scheduling tasks performed at the same time. Set this parameter to 0 to disable Region Merge.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('327', 'schedule', 'high-space-ratio', 'PD', null, 3, null, '["0.1", "1.0"]', 0, 1, 3, 0, 'The threshold ratio below which the capacity of the store is sufficient. If the space occupancy ratio of the store is smaller than this threshold value, PD ignores the remaining space of the store when performing scheduling, and balances load mainly based on the Region size. ', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('328', 'schedule', 'low-space-ratio', 'PD', null, 3, null, '["0.1", "1.0"]', 0, 1, 3, 0, 'The threshold ratio above which the capacity of the store is insufficient. If the space occupancy ratio of a store exceeds this threshold value, PD avoids migrating data to this store as much as possible. Meanwhile, to avoid the disk space of the corresponding store being exhausted, PD performs scheduling mainly based on the remaining space of the store.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('329', 'schedule', 'tolerant-size-ratio', 'PD', null, 0, null, '["0", "102400"]', 0, 1, 3, 0, 'Controls the balance buffer size.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('330', 'schedule', 'enable-cross-table-merge', 'PD', null, 1, null, '["true","false"]', 0, 1, 3, 0, 'Determines whether to enable the merging of cross-table Regions.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('331', 'schedule', 'region-score-formula-version', 'PD', null, 1, null, '["v1","v2"]', 0, 1, 3, 0, 'Controls the version of the Region score formula.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('332', 'schedule', 'enable-joint-consensus', 'PD', null, 1, null, '["true","false"]', 0, 1, 3, 0, 'Controls whether to use Joint Consensus for replica scheduling. If this configuration is disabled, PD schedules one replica at a time.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('333', 'replication', 'max-replicas', 'PD', null, 0, null, '["1","3","5","7"]', 0, 1, 3, 0, 'The number of replicas, that is, the sum of the number of leaders and followers. The default value 3 means 1 leader and 2 followers. When this configuration is modified online, PD will schedule Regions in the background so that the number of replicas matches this configuration.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('334', 'replication', 'location-labels', 'PD', null, 1, null, null, 0, 1, 3, 0, 'The topology information of a TiKV cluster.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('335', 'replication', 'isolation-level', 'PD', null, 1, null, null, 0, 1, 3, 0, 'The minimum topological isolation level of a TiKV cluster.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('336', 'replication', 'strictly-match-label', 'PD', null, 1, null, '["true","false"]', 0, 1, 3, 0, 'Enables the strict check for whether the TiKV label matches PD''s location-labels.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('337', 'replication', 'enable-placement-rules', 'PD', null, 1, null, '["true","false"]', 0, 1, 3, 0, 'Enables placement-rules.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('338', 'replication', 'flow-round-by-digit', 'PD', null, 0, null, null, 0, 1, 3, 0, 'PD rounds the lowest digits of the flow number, which reduces the update of statistics caused by the changes of the Region flow information.', '1609459200000', '1609459200000');
INSERT INTO parameters (id, category, name, instance_type, system_variable, type, unit, range, has_reboot, has_apply, update_source, read_only, description, created_at, updated_at) VALUES ('339', 'label-property', 'key', 'PD', null, 4, null, null, 1, 1, 0, 0, 'The label key for the store that rejected the Leader.', '1609459200000', '1609459200000');
